import './App.scss'

function App() {
    const picturesArr = (()=>{
        let size = Math.round(Math.random() * 6);
        let pictureArr = ['aaa','bbb','ccc','ddd','eee','fff'].map(e => {
            return {
                src:`@/pictures/${e}.`
            }
        })
    })()
    return(
        <div className='App-container'>
            <h1>轮播图</h1>
            <SlidePictures picturesArr={picturesArr} width={700} height={450}/>
        </div>
    );
}

export default App;
